import React from 'react'

interface TabButtonProps {
    onChange: Function;
    className: any;
    value: String;
    isActive: Boolean;
}

const TabButton = (props: TabButtonProps) => {
  return (
    <button onClick={props.onChange} className={props.className}>
        {props.value}
    </button>
  )
}

export default TabButton
